import React from 'react';
import { NavLink, useRoutes } from 'react-router-dom'
import routes from './routes'
// import { Menu } from 'antd';
import Header from './components/Header';
import './App.css';

function App() {
  const element = useRoutes(routes)
  return (
    <div>
      <Header></Header>
      <Menu
        style={{
          width: 256,
        }}
        mode="inline"
      >
        <Menu.Item to='/jobManagemen'>作业管理</Menu.Item>
        <Menu.Item to='/explorationProject'>勘探项目</Menu.Item>
      </Menu>
      <NavLink className='list-group-item' to='/jobManagemen'>jobManagemen</NavLink>
      <NavLink className='list-group-item' end to='/explorationProject'>explorationProject</NavLink>
      {/* {element} */}
    </div>
  );
}

export default App;
